export const Icon = ({ 
  type, 
  color,
  className, 
  style 
}: IconProps) => {
  const svg = svgPaths[type as keyof typeof svgPaths];
  if (!svg) return null;

  return (
    <svg
      xmlns="http://www.w3.org/2000/svg"
      viewBox={svg.viewBox}
      width={svg.size.width}
      height={svg.size.height}
      fill="none"
      className={className}
      style={{ 
        color,
        ...style 
      }}
    >
      {svg.content(color || 'currentColor')}
    </svg>
  );
};

